import React from 'react';

const QuakesList = (props) => {

    const quakesList = props.quakes.features.map((quake, i) => {

        return <p>{quake.properties.title} / {quake.properties.time}</p>
    });

    return(
        <div id="info">
            {quakesList}
        </div>
    )


}

export default QuakesList;
